window.bookSummaryJSON = "<p>On a trip to reignite the spark in her marriage, Alaina Grace’s upgraded first-class ticket places her far from her husband and next to the notorious Jack Volmer, a former teen actor who’d previously hung on posters in her childhood bedroom. When an unusual storm forces their plane out of the sky, her ticket will save her life and force her to question everything.</p> <p>Ripped from the comforts of her world and injured, Alaina finds herself on a raft in the ocean, completely separated from her husband among eleven strangers.</p> <p>Seeking comfort in the presence of the single familiar face, Alaina must choose between her past and her present; between two loves in two contrasting worlds, and must let go of one in order to keep the other.</p> <p>Arriving on an island in the middle of the Pacific, strangers become family as they navigate unfamiliar terrain to uncover hidden mysteries, endless adventure, and love where they least expected to find it.</p>"; 
